INSERT INTO `quest_step` VALUES (2, 'L\'arroseur arrosant ', 'Erty Trapchet a oublié de s\'occuper de ses plantes, il faut se rendre à son domicile pour les arroser.', 3000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (3, 'L\'epyss s\'enlise', 'Erty Trapchet veut étudier des graines de pissenlit, pour les comparer avec de l\'Epyss...', 6000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (4, 'Mais quel herbier !', 'Pour ses recherches, Trapchet a besoin d\'étudier la répartition géographique des fleurs aux alentours d\'Astrub.', 6500, 500, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (5, 'L\'aphone et la flore', 'Trois-Fleurs, un ami de Trapchet réside à Amakna et connait parfaitement la flore de sa région. Il faut lui demander des renseignements sur les fleurs agressives qui s\'y trouvent.', 12500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (6, 'Du lailait pour un chacha', 'Apporter du lailait pour le chacha malheureux', 1220, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (7, 'De la boubouffe', 'Se renseigner sur la nourriture d\'un Chacha moyen auprès de ceux que vous rencontrez. Et ramenez un peu de nourriture à ce Chacha.', 1220, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (8, 'Promenade chacrée', 'Promener le Chacha dans la ville', 1500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (9, 'Chacha héros ?', 'Trouver ce qui fera de ce frêle Chacha un héros auprès de sa compagne.', 3060, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (10, 'Une amulette velue ?', 'Rapporter des pattes d\'arakne à la bijoutière, elles sont nécessaires à la fabrication d\'une amulette.', 1700, 0, '6773', NULL, 0);
INSERT INTO `quest_step` VALUES (11, 'Recyclage d\'eau puante', 'Rapporter de la bave de bouftou à Shani Sings', 1700, 200, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (12, 'Un peu de piquant', 'Shani a oublié de prévoir assez d\'épines de champ champ pour l\'épreuve de demain. Allez en récuperer.', 2600, 250, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (13, 'Anneau cédé', 'Shani vous a donné un anneau possédant des pouvoirs latants. Pour les réveiller il va falloir aller tuer un abraknyde.', 11000, 1200, '6793', NULL, 0);
INSERT INTO `quest_step` VALUES (14, 'Le jeu de Goh', '...', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (15, 'Le grenier hanté', '...', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (16, 'Les enigmes de Saifuki', '.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (17, 'Le manuscrit divin', '.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (20, 'Discrétion assurée', 'Trouvez Ogivol Scalarcin, vous devriez trouver l\'entrée de son repère grâce à une trappe dérobée dans le sol du dépôt de bois.', 600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (21, 'Ca va saigner !', 'Il vous prend le besoin d\'en savoir plus sur vous-même et vous décidez d\'aller dans un endroit sanglant... la boucherie.', 600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (22, 'L\'espion qui valait 3 kamas', 'Trouvez Ztiv Oztin et proposez lui vos services...', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (23, 'L\'appel du fou', 'Eilof demande une pelle de boisaille pour construire son abri anti-apocalypse.', 4000, 50, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (24, 'Pickpocket', 'Trouvez un moyen de vous procurer le rapport d\'espion et apportez-le à Ztiv Oztin.', 1200, 0, '6784', NULL, 0);
INSERT INTO `quest_step` VALUES (25, 'Ca sang le roussis !', 'Votre maître a entendu qu\'un mineur a récemment été changé en mineur sombre. Il veut en avoir l\'artère net !', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (26, 'Recherche Jambes rapides', 'Le Boulanger a besoin de livrer 4 personnes dans l\'urgence. Aller déposer les gâteaux chez chacun le plus vite possible.', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (27, 'Du pain sur la planche', 'Pour construire sa cabane indestructible, Eilof demande deux planches de Châtaignier, ainsi que quelques pains pour survivre au moins 3 jours au désastre...', 8000, 450, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (28, 'Un livreur dragueur', 'Vérifier si le livreur : Louc Drif, est réellement malade.', 2000, 500, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (29, 'A la recherche du nouveau livreur', 'Trouver une personne à la fois forte et agile pour prendre la place de nouveau livreur.', 2000, 250, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (30, 'Une derniere livraison', 'Aller livrer le gâteau à grand-mère', 5000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (31, 'Les bandits manchots', 'Le campement des bandits manchots se situe au nord de la forêt d\'Astrub, la peluche se trouve certainement sur l\'un des bandits du camp...', 2000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (32, 'Qui sème le vhan, récolte l\'Artempeth', 'Pour tester sa théorie sur l\'apparition des fleurs carnivores, Trapchet demande de semer des graines de rose obscures, puis de les récolter...', 15000, 2500, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (33, 'Le bouquet de lin', 'Il faut récuperer des fleurs de Lin pour la mère de Pleur Nycheuz. Seul les alchimistes peuvent cueillir ces fleurs...', 2000, 200, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (34, 'La bête poilue', 'Le berger Menge Paca a des ennuis avec une bête poilue, il cherche donc quelqu\'un capable d\'en savoir plus sur cette créature...', 750, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (35, 'Compte rendu Osamodas', 'Abrazelon Sixgriffe a parlé de l\'homme Ours, capable de controler des créatures trés puissantes. Avant de se mettre à sa poursuite, il faudrait avertir Menge Paca de vos découvertes...', 3000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (36, 'Sur la piste de l\'Ours', 'Il faut suivre les traces de pas de l\'ours et trouver sa tanière...', 3000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (37, 'En garde Homme Ours ', 'D\'après Abrazelon il faut attaquer l\'homme Ours à plusieurs pour être sûr qu\'il utilise son manuscrit en combat. Il faut ensuite lui rapporter pour qu\'il l\'authentifie.', 9000, 2500, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (38, 'Livraison de Erty Trapchett', '', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (39, 'Livraison de Podbra Manchot', '', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (40, 'Livraison de la mine', '', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (41, 'Stupides Enutrofs !', 'Les Enutrof ont découvert quelque chose, ils auront besoin de toi.', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (44, 'Fleur de Dzibi', 'Pour que votre maîtresse de classe puisse vous confectionner un bâton digne de ce nom, vous devez trouver de la fleur de Dizbi.', 600, 0, '6798', NULL, 0);
INSERT INTO `quest_step` VALUES (45, 'Besoin de main-d\'oeuvre', 'Trouvez Howard le Simaisrien et remettez-lui la lettre de Joe Pierlivet.', 600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (46, 'Extrait de Dzibi', 'La fleur telle quelle ne conviendra pas, il vous faut une infusion !', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (47, 'Livraison express', 'Vous devez rapporter l\'infusion à votre maîtresse de guilde pour qu\'elle puisse fabriquer votre bâton ! \nSi au passage vous avez le temps et les moyens d\'aller apporter de l\'infusion à votre fournisseur de fleur, cela lui fera grandement plaisir.', 1200, 0, '6781', NULL, 0);
INSERT INTO `quest_step` VALUES (49, 'Besoin de renforts', 'Allez chercher de l\'aide auprès des Féca et Eniripsa', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (51, 'Besoin d\'une pelle', 'Retournez faire votre rapport à Joe pour obtenir votre récompense.', 1200, 0, '6786', NULL, 0);
INSERT INTO `quest_step` VALUES (52, 'Besoin de laine', 'Le tailleur Alit a besoin de laine de boufton blanc et noir. Si vous lui apportez il vous fera probablement quelque chose de sur-mesure', 2500, 0, '6800', NULL, 0);
INSERT INTO `quest_step` VALUES (53, 'Doublure puante', 'Alit vous conseille de rajouter une doublure à votre cape. Mais pour cela il vous faut lui ramener de la laine de bouftou.', 3500, 0, '6801', NULL, 0);
INSERT INTO `quest_step` VALUES (54, 'Tout ça pour un cache oreille !', 'Ramener les matériaux nécessaires à la confection d\'un cache oreille. Certains vont être durs à avoir, il faudra peut-être demander de l\'aide.', 11000, 500, '6802', NULL, 0);
INSERT INTO `quest_step` VALUES (55, 'Le sang du wabbit GM', ' ', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (56, 'Enquête sur une disparition... de Maison', '', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (57, 'Analyse de sang', ' ', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (58, 'Wogew Wabbit', ' ', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (60, 'Bon sang, mais c\'est bien sûr!', '-', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (61, 'Un métal douteux', 'Apporter le sac de kamas douteux à une personne qui pourra en tirer quelque chose d\'intéressant.', 600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (62, 'Affinement douteux', 'Transformer votre métal douteux.', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (63, '... doute !', 'Rapporter l\'épée à votre maître de guilde. Il vous y apposera la marque de votre classe.', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (64, 'Je veux tout tout de suite', 'Devenir le roi du monde', 500, 1000, '968,1;948,5;11,10;27,47;453,3;437', NULL, 0);
INSERT INTO `quest_step` VALUES (65, 'Je veux plus rien !', 'Je veux moins d\'xp et moins de kamas', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (67, 'Comment forger une épée\' pour les nuls', 'Vous avez besoin d\'un forgeron pour créer une épée.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (68, 'L\'utilité d\'une bonne poignée d\'épée', 'Trouvez une poignée afin de faire forger votre épée.', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (69, 'L\'importance des finitions', 'Apportez l\'épée fraîchement forgée à votre maître.', 900, 0, '6780', NULL, 0);
INSERT INTO `quest_step` VALUES (70, 'Echange metaria contre rendez-vous', 'Louc doit résoudre son problème de coffre et se préparer en même temps pour son premier rendez-vous. Allez lui chercher deux roses, une pour chaque fille.', 1500, 500, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (71, 'A la recherche des petits cailloux', 'Examiner les petits cailloux pour les comparer à ceux trouvés chez Louc. Pour cela rendez-vous sur les différents lieux suspects.', 1500, 250, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (72, 'Voleur de coeur', 'Les petits cailloux proviennent des alentours des mines au nord-est du village. Trouvez-y le coffre de Louc.', 4000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (73, 'Cours Forest !', 'Vous aimez les enfants ? Celui-ci vous allez le détester...', 600, 50, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (74, 'Le sous-sol de la Bibliothèque', 'Comme tous les sous-sols de bibliothèque, on y trouve toute sorte de livres et des toiles d\'araknes... mais dans celle-ci, il y a comme une atmosphère mystérieuse qui y rôde...', 2500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (75, 'Arc-Crâ-Daba-Gras', 'Ha comme c\'est beau de faire fabriquer son premier arc.', 1200, 0, '6783', NULL, 0);
INSERT INTO `quest_step` VALUES (76, 'La nécessité de savoir s\'en servir', 'Apprenez le maniement de votre nouvelle arme en attaquant quelques insectes.', 900, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (77, 'Bien jolie cobaye', ' ', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (78, 'Crâtastrophe', 'Vous allez maintenant apprendre à tirer à l\'arc.', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (80, 'Souterrain ténébreux', 'Une porte dérobée dans la montagne donne accès à un souterrain, encore faut il trouver comment...', 2500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (81, 'Souterrain mystérieux', 'Une dalle perchée en haut d\'une montagne et une porte derobée... il va falloir trouver des volontaires pour arriver au bout de cette galerie...', 2500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (82, 'Un remède de Tabi', '  ', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (83, 'Stabiliser le patient', ' ', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (84, 'Bien jolie cobaye', ' ', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (85, 'Un remède de Tabi', ' ', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (86, 'Stabiliser le patient', ' ', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (87, 'Escorte de Mélange', 'Tek Abir, le tavernier du village, est obligé de couper sa bière avec de l\'eau car on lui vole la sienne. Trouvez le livreur au sud-Ouest en longeant la route puis escortez-le.', 2000, 500, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (88, 'Une fin pour l\'oppression ?', 'Mettre un terme au vol de bière', 4000, 3000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (90, 'Kit de vision', 'Récupérer différentes ressources pour aider Montrakwartz à voir l\'avenir', 600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (91, 'Le futur c\'est l\'aventure !', 'Montrakwartz a besoin d\'une peau de larve bleu pour terminer sa machine.', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (92, 'L\'avenir ça fait pas rire !', 'Montrakwartz vous en apprend plus sur votre avenir proche. ', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (93, 'Suborhube...', 'Aidez votre maître de guilde à trouver un remède pour soigner ses Tofus.', 1200, 0, '6849', NULL, 0);
INSERT INTO `quest_step` VALUES (94, 'Livraison', 'Apportez le remède que vous avez obtenu à Clint Pot. Pour soigner les Tofus ou les Enutrofs, je n\'ai pas bien compris. N\'oubliez pas de faire un rapport à votre maître de guilde.', 1800, 0, '6785', NULL, 0);
INSERT INTO `quest_step` VALUES (102, 'Bois d\'Arash', 'Procurez-vous du bois d\'Arash : en sacrifiant la nature, vous pourrez vous lier avec elle.', 1200, 0, '6853', NULL, 0);
INSERT INTO `quest_step` VALUES (103, 'La maison de Nycheuz', 'Pleur Nycheuz a oublié où se situe sa maison, terrorisée, elle n\'ose plus s\'aventurer seule en ville...', 5750, 250, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (104, 'Rituel', 'Trouvez la personne qui vous aidera à confectionner votre bâton d\'initié.', 1800, 0, '6782', NULL, 0);
INSERT INTO `quest_step` VALUES (106, 'Première salle', 'Trouver comment se servir des trois Dofus', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (107, 'Deuxième Salle', 'Trouver la clef', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (109, 'Trouver le hors-la-loi', 'Ogivol a été aperçu du côté de Brâkmar. Il est recherché pour avoir dérobé une foultitude de choses, et notamment des documents secrets. \nIl est condamné à l\'emprisonnement à Astrub. \n', 0, 32000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (111, 'Trouver le hors-la-loi', 'Fouduglen parcourt la ville d\'Astrub à la recherche des glands succulents à se mettre sous la dent.', 0, 245, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (113, 'Trouver le hors-la-loi', 'Certains disent l\'avoir vu du côté des Landes de Sidimote. Il est recherché pour insoumission à l\'ordre cosmique. \nBrumen Tinctorias est condamné à l\'emprisonnement à Astrub. \n', 0, 33600, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (115, 'Trouver le hors-la-loi', 'Certains disent avoir vu Qil Bil vers les plaines de Sidimote. \nQil Bil est recherché pour arrachage de membres. \nIl est condamné à l\'emprisonnement à Astrub. \n', 0, 19200, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (116, 'Trouver le hors-la-loi', 'Certains disent avoir vu Nervoes Brakdoun du côté de la forêt des Abraknydes \nRecherché pour vol de bijouterie \nCondamné à l\'emprisonnement à Astrub \n', 0, 12005, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (118, 'On a faim !', 'Les bouftous d\'Allisteria ont faim. Il va falloir tous les nourrir !', 600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (119, 'Trouver la hors-la-loi', 'Certains disent avoir vu Frakacia Leukocytine du côté du village des Bandits Manchots. \nElle est recherchée pour ponctions illégales d\'Hémoglobine. \nCondamnée à l\'emprisonnement à Astrub. \n', 0, 2000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (121, 'Trouver et escorter le hors-la-loi', 'Il est probable que Padgref Demoël se trouve dans le Nord Ouest des plaines de Cania, du côté du bois de Litneg. \nIl est condamné à l\'emprisonnement à Astrub pour détérioration de Bouftou domestique et tapage nocturne. \n', 0, 84500, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (127, 'Boudin Bouilli de Bouftou', 'Sauver la tradition du bon Boudin Bouilli de Bouftou', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (131, 'Tac Tic !', '...', 2500, 20, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (132, 'Bats toi si t\'es une Feca', 'Le célèbre Fallanster vous a demandé d\'entraîner sa fille au combat.', 1200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (133, 'Une belle paire...', 'Phite Pouque cherche des ciseaux forgés, elle conseille d\'aller voir le forgeron de l\'hotel des ventes pour lui en acheter...', 2000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (134, 'Des cheveux... toujours des cheveux...', 'Phite cherche à récuperer la totalité des types de cheveux des habitants d\'Astrub, pour en faire des postiches.', 3000, 150, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (135, 'Un début de piste', 'Les Enutrofs partis à la recherche des ranifftous se sont  probablement égarés loin dans les profondeurs des galeries. Les lieux sont infestés de milirats d\'égoutants...', 4000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (139, 'Le début de la fortune', 'Collecter 10 pattes d\'Araknées pour le compte de Ant Emicheun. Ou pour le votre... qui sait ? En tout cas, ça semble rentable.', 1000, 400, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (140, 'Plumes malades', 'Avec vingt plumes, on doit pouvoir faire un plumeau. Ceci dit, vu les plumes...', 1000, 50, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (141, 'Les oeufs peuvent-ils nager ?', 'Plus d\'agent infectieux dans les plumes de Tofus malades. Par contre leurs oeufs en seraient probablement une piste pour les Eniripsa. Encore des Kamas à se faire !', 2500, 375, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (142, 'Encore de la collecte...', 'Les Crâs tirent leur épingle du jeu, ou plus précisement, leurs flèches. Les Araknes malades semble contenir dans leurs pattes de quoi faire du poison... business is business...', 750, 75, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (143, 'Chasse sauvage', 'De sombres créatures ruinent les affaires d\'Ant Emicheun, s\'en débarasser lui semble être une solution... du moins en attendant de comprendre ce qu\'elles font ici...', 5000, 750, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (144, '... ou crocs de Xelors.', 'Les Xélors semblent intéressés. D\'après Ant, ce serait pour mettre des aiguilles sur leurs sabliers... enfin il n\'est pas sûr. ', 3000, 500, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (145, '... de ciseaux', 'Avec les ciseaux tout neufs que vous avez récuperer, c\'est Phite qui va etre contente !', 1750, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (146, 'Un tien vaut mieux que 2 pods de rat', 'Débarrassez-vous de ce Rat d\'égoutant... il a l\'air malade, ça ne devrait pas être trop compliqué... enfin, à plusieurs quoi.', 8000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (147, 'La cave infestée', 'Aller dans la cave de grand-mère et exterminer la menace.', 10, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (148, 'Récompense méritée', 'Reparler à grand mère et lui montrer la tête de sousouris.', 40, 30, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (150, 'La récompense', 'Allez chercher votre récompense chez Louc Drif.', 5000, 0, '1519', NULL, 0);
INSERT INTO `quest_step` VALUES (153, 'Y\'a du soleil à Pandala !', 'A votre arrivée dans Pandala, vous êtes invité à vous mettre en règle avec l\'administration : régler la taxe sur la Pandrista s\'impose.', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (154, 'Pandrista à gogo !', 'Trouvez un marchand ambulant : vous pourrez lui régler la taxe sur la Pandrista. N\'hésitez pas à insister lourdement.', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (155, 'Ma première Shaman Party', 'Allez demander de l\'aide au Shaman de toute urgence !', 4700, 0, '0', '1|2507;', 0);
INSERT INTO `quest_step` VALUES (156, 'Le Grandapan : Un pandawa sympa', 'Les Enutrofs en cure chez le Shaman vous conseillent d\'aller voir le Grandapan. Très au fait des coutumes locales, il est aussi un fin connaisseur des légendes Pandawaïennes.', 500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (157, 'La statue de la déesse', 'Le Grandapan a accepté le cadeau des Enutrofs avec joie. Fervent admirateur des chercheurs de Dofus, il vous accueille à bras ouverts.', 750, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (158, 'Libations pour la déesse', 'Grâce à vous, l\'Assistant du Shaman peut commencer son rituel de remerciement à la déesse. Il sera fin prêt dès que vous lui aurez remis une offrande pandawaïenne traditionnelle.', 750, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (159, 'Le sage Lenald', 'Une vendeuse de rafraîchissement Pandawaïenne vous conseille de rencontrer le sage Lénald. Selon elle, lui seul détient la vérité sur Pandala et ses secrets.', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (160, 'Un tiens vaut mieux que deux tu boiras', 'La voie de l\'eau consiste à résister à... l\'absorption et à l\'immersion (partielle et totale) d\'eau par tous les moyens. Ne jamais en boire, se laver uniquement en cas de nécessité. Trouvez le maître de la voie de l\'Eau : il en sait plus qu\'il n\'y paraît', 9000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (161, 'Chez le forgeur de Boucliers', 'A Terrdala, personne n\'est disponible pour aller porter les ressources à la forge de boucliers. Forger des boucliers est pourtant indispensable aux guerriers Pandawas... Heureusement que vous êtes là !', 750, 0, '7097', NULL, 0);
INSERT INTO `quest_step` VALUES (162, 'L\'accent sur le voyage', 'Le sage Lenald vous demande d\'aller au village de l\'Aerdala...ou de Terrdala, impossible d\'être sûr à cause de son accent. Une fois sur place, parlez au maître Pandawushu.', 750, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (163, 'Souterrain impénétrable', 'Gare au Dragoeuf ! Il va falloir traverser leur territoire pour accèder à cette nouvelle grotte...', 2500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (164, 'Souterrain hasardeux', 'Ce souterrain risque de vous faire perdre patience!', 2500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (165, 'Qui a peur du méchant chacha', 'Poochan recherche son futur mari, les seuls indices qu\'elle a sont qu\'il doit toujours se trouver à Pandala, et qu\'il a peur des chachas. Le plus simple est encore de se transformer en chacha et de sauter dans les bras de tout le monde non ?', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (166, 'Arrangement à l\'amiable', 'La coutume ici veut que le père décide qui son fils ou sa fille épousera. Vous devez donc convaincre le père de vous céder son fils. Il faudra faire tout ce qu\'il faut pour ça.', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (167, 'Conquête des Dento', 'Pour libérer Lanma de ses obligations, il va falloir rompre la promesse de mariage qu\'il a avec une fille du Dojo Dento.', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (168, 'Petit entrainement au bouclier', 'Pour vous remercier de la livraison, le forgeur de bouclier vous a fait cadeau d\'un petit bouclier d\'entraînement, Parlez au maitre du Dojo pour un petit entraînement.', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (169, 'Zero Dofus', 'Le messager du sage Lenald vous envoie à la lisière du village d\'Aerdala. Sur le chemin, vous méditez ses derniers mots : \" + \"\"\" + \"Plus d\'un aventurier s\'est fait mal accueillir en allant à Aerdala. On les dit alliés des Pandawas rebelles, ceux qui sabotent tous les accès de l\'île...\" + \"\"\" + \" ', 2000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (170, 'Un nouveau message du sage', 'Un messager vous apporte un message, parlez-lui !', 5000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (171, 'S\'évader c\'est la santé', 'Apparemment, vous n\'êtes pas le bienvenu à Aerdala... saurez-vous échapper à votre destinée ? Il vaudrait mieux...', 10000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (172, 'Amine, de rien!', 'Il faut transmettre une lettre à Amine au temple Xelor de la part du surveillant Henual.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (173, 'Un Kouartz et ça repart', 'Amine propose à Henual d\'utiliser le dernier recours :... du Kouartz !', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (174, 'Balade dans l\'Espace et le Temps d\'Amakna ', 'Cette Balade dans l\'Espace et le Temps d\'Amakna (B.E.T.A.) permettra de sauver le monde ! \n', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (175, 'Legende Lenalde', 'Enfin ! Vous touchez au but ! Mais vous n\'êtes pas au bout de vos surprises ! Le Lénald de l\'île des Wabbits va vous révéler un grand secret longtemps gardé...', 7500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (176, 'Dark Vlad, un gars qui en a !', 'Purifiez votre âme et lavez-vous les oreilles : le sage Lénald vous révèle la vérité sur le Dofus de Pandala.', 40000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (177, 'A la santé de la déesse !', 'Nouvel arrivé à Pandala, l\'Assistant Shaman vous demande de faire honneur à votre déesse : une offrande spiritueuse serait la bienvenue... Votre initiation commence.', 500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (178, 'Boire et déboires', 'Un marchand ambulant vous vendra certainement une de ces boissons fermentées qui ont fait la réputation de l\'île. Il vous suffit d\'en trouver un !', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (179, 'Shaman connexion', 'Le shaman est un Pandawa qui en sait beaucoup sur les agissements de certains... Apparemment, tout n\'est pas rose à Pandala !', 3000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (180, 'Passage de grade Ikwa', 'Il faut se présenter au maître un samedi pour passer l\'évaluation du grade Ikwa.', 5000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (181, 'Passage de grade Nikwa', 'Il faut se présenter au maître un samedi pour passer l\'évaluation du grade Nikwa.', 10000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (182, 'Passage de grade Sankwa', 'Il faut se présenter au maître un samedi pour passer l\'évaluation du grade Sankwa.', 15000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (183, 'Passage de grade Yonkwa', 'Il faut se présenter au maître un samedi pour passer l\'évaluation du grade Yonkwa.', 20000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (184, 'Passage de grade Gokwa', 'Il faut se présenter au maître un samedi pour passer l\'évaluation du grade Gokwa.', 30000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (185, 'Passage de grade Rokwa', 'Il faut se présenter au maître un samedi pour passer l\'évaluation du grade Rokwa.', 30000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (186, 'Shodanwa', 'Il faut se présenter au maître un samedi pour passer l\'évaluation du grade Shodanwa.', 30000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (187, 'Début entrainement', 'Pour commencer l\'entraînement, il faut obtenir un certificat shamanique ainsi qu\'une tenue Pandawushuka.', 0, 0, '7313', NULL, 0);
INSERT INTO `quest_step` VALUES (188, 'Dans le temple de votre dieu', 'Suivant les conseils du sage Lenald, vous préparez votre prochaine expédition. Pour cela il vous faut vous rendre dans le temple de votre divinité en Amakna.', 7500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (189, 'Nidanwa', 'Il faut se présenter au maître un samedi pour passer l\'évaluation du grade Nidanwa.', 40000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (190, 'Sandanwa', 'Il faut se présenter au maître un samedi pour passer l\'évaluation du grade Sandanwa.', 50000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (191, 'Yondanwa', 'Il faut se présenter au maître un samedi pour passer l\'évaluation du grade Yondanwa.', 60000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (192, 'Bons baisers d\'Astrub', 'Le shaman est débordé, il n\'a pas de temps à vous consacrer. Entre les Pandikazes, la maladie des Enutrofs d\'Astrub et le reste...Il vous conseille de parler à Pyrite, Enutrof en quarantaine, si vous désirez l\'aider.', 1500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (193, 'Le réceptacle aux Dofus', 'Le Grandapan a accepté le cadeau des Enutrofs avec joie. Fervent admirateur des Dofus, il vous accueille à bras ouverts. Pour satisfaire votre curiosité à propos des Dofus, il vous invite à aller voir le réceptacle aux Dofus.', 1500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (194, 'Un tiens vaut mieux que deux tu boiras', 'La voie de l\'eau consiste à résister à... l\'absorption et à l\'immersion (partielle et totale) d\'eau par tous les moyens. Ne jamais en boire, se laver uniquement en cas de nécessité. Trouvez le maître de la voie de l\'Eau : il en sait plus qu\'il n\'y paraît.', 10000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (195, 'Ecuyer, Palefrenier, même combat.', 'Des Brâkmariens ont détruit des greniers bontariens. Il faut  trouver un moyen de ravitailler les montures de la milice en allant trouver une solution auprès de Merlan, à l\'atelier des alchimistes.', 50000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (196, 'Dans la peau d\'un espion.', 'Suite à l\'incendie d\'entrepôts de nourriture par les Brâkmariens, Ebru Of El veut savoir ce que les ennemis manigancent.', 50000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (197, 'Levez-vous et marchez.', 'Elviana Tirips veut interroger les renégats bontariens mais avant de pouvoir le faire il faut les ressusciter.', 50000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (198, 'Inquiétudes brâkmariennes.', 'Ledrob se demande ce qui se trame à Bonta en ce moment. Il vous envoie sur place pour prendre contact avec l\'espion Finche Aticus.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (199, 'Lève-toi et marche.', 'Divad ne parvient pas à ressusciter Terra Tibya pour l\'interroger. Il faut donc improviser un sort de résurrection qui en soit capable et c\'est la mission qui vous a été confiée.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (200, 'Brâkmariens bras cassés.', 'Les agents brâkmariens étant des incapables, Kaffra vous a demandé de vous rendre à Astrub et de convaincre le marchand bontarien Raymond Santho de ravitailler Brâkmar.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (201, 'Trouver le hors-la-loi', 'Rok a été aperçu au Nord de Pandala. \nIl est condamné à l\'emprisonnement à Astrub. \n', 0, 6250, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (202, 'Trouver le hors-la-loi', 'Musha a été aperçu au sud de Pandala. \nIl est condamné à l\'emprisonnement à Astrub. \n', 0, 64000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (203, 'Trouver le hors-la-loi', 'Marzwel a été aperçu du côté d\'Aerdala \nIl est condamné à l\'emprisonnement à Astrub. \n', 0, 25000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (204, 'Trouver le hors-la-loi', 'Zatoïshwan a été aperçu du côté de Terrdala. \nIl est condamné à l\'emprisonnement à Astrub.\n', 0, 112500, '0', NULL, 0);
