INSERT INTO `quest_step` VALUES (220, 'La caverne du Koulosse', 'On raconte que le Koulosse habite cette caverne depuis des lustres. L\'éleveur qui s\'y est aventuré n\'en n\'est jamais revenu...', 0, 0, '0', NULL, 0);
