INSERT INTO `quest_step` VALUES (288, 'Une simple étape', 'Malgré l\'âpreté des combats que vous avez dû livrer, ils n\'étaient qu\'une simple étape.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (289, 'Un message très clair.', 'Kal, une sorte de machine, vous aide à poursuivre votre quête. Avec lui au moins, les objectifs sont clairs.', 250000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (290, 'Des problèmes ?', 'Kal n\'a pu vous transmettre l\'intégralité de son message mais avec la clef vous devinez aisément ce que vous devez faire.', 300000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (291, 'Défaillance technique.', 'Kal n\'a pas résolu ses problèmes mais cela ne vous empêche pas de poursuivre votre quête.', 350000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (295, 'Il manque un boulon', 'Kal reste bloqué mais vous donne les clefs.', 400000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (296, 'La dernière clef.', 'Kal vous a remis la dernière de ses clefs. Vous approchez du but.', 450000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (297, 'Consécration ?', 'Kal n\'a plus rien à vous confier. Retournez voir le Maître des clefs.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (298, 'Le maître à rubans', 'Le maître a décidé de vous imposer encore des épreuves. Cela devient lassant.', 500000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (299, 'Le maître étalon', 'Le maître vous prend pour une vraie bête de guerre, encore une épreuve.', 725000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (300, 'Le maître aux normes', 'Il semble que vous ne puissiez échapper à cette interminable liste de massacres. Si il faut en passer par là...', 800000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (301, 'Le maître décolle.', 'Ca y est enfin, le maître des clefs vous a confié votre dernière épreuve.', 875000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (302, 'Enfin !', 'Ca y est, vous êtes au bout de vos peines. Metag doit tenir sa promesse maintenant. A vous l\'ultime relique de sa famille !', 1000000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (306, 'Le maître ou ne pas mettre', 'Cette fois-ci, le maître vous envoie à l\'intérieur de terres en conflit.', 575000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (307, 'Le maître du jeu', 'Encore un territoire hostile à traverser.', 650000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (308, 'Une mère affolée', 'Madame El est paniquée. Elle recherche ses enfants dans le village d\'Amakna.', 0, 0, '0', NULL, 0);
