INSERT INTO `quest_step` VALUES (319, 'Trouver la recette de la bière Bwork', 'Pinta Gone recherche la recette de la fameuse bière Bwork. Il pense qu\'elle se trouve dans une salle étrange dans le territoire Bwork.', 2500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (320, 'Jeu Trooll règles avancées', 'Raxitik est terrorisé. Il sait que les Bworks vont le livrer au Trooll pour qu\'il pratique une partie de jeu Trooll règles avancées avec lui. Il faut absolument éliminer ce Trooll qui menace l\'intégrité physique de Raxitik.', 30000, 0, '2562', NULL, 0);
INSERT INTO `quest_step` VALUES (321, 'Tuer du Bwork', 'Gobatchef veut que les Bworks soit massacrés avant qu\'ils ne massacrent les Gobelins.', 20000, 1000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (322, 'Krazybwork veut redevenir débile.', 'Krazybwork a trop mangé de Goblins lors de la bataille de Bworkdrift. Il est devenu intelligent et veut redevenir débile. Le mieux serait de lui mettre un bon coup sur la tête !', 0, 500, '8527', NULL, 0);
INSERT INTO `quest_step` VALUES (323, 'Bworkidais le paxifik', 'Baston ou pas baston ?', 15000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (324, 'Un scalpel utile', 'Bworknroll a besoin de morceaux pour composer sa compagne idéale.', 120000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (325, 'A découper en suivant les pointillés', 'Bworknroll a besoin de remplir sa créature d\'organes frais (et juteux).', 150000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (326, 'Ne pas oublier l\'essentiel : la moule !', 'Bworknroll a besoin d\'une moule qui sort de l\'eau pour finir sa créature de rêve.', 230000, 5000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (327, 'Pinta Gone veut lire la recette', 'Il a déjà acheté tout le matériel pour sa brasserie de bière. Il ne lui manque que la recette.', 7500, 500, '8145,10', NULL, 0);
INSERT INTO `quest_step` VALUES (328, 'Chaperonner Titi', 'Le père de Titi aimerait qu\'il devienne mage. Pour cela, il faut l\'amener chez le plus puissant des Bworks Mages avec de quoi manger.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (329, 'Faire ses preuves', 'Comme vous n\'êtes pas très connu alentours, les autochtones ne savent pas encore s\'ils peuvent vous faire confiance.', 105, 0, '0', '1|3548;', 0);
INSERT INTO `quest_step` VALUES (330, 'Des peaux vertes', 'Bworkepik veut des peaux de gobelins pour ses femelles.', 45000, 30000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (331, 'Une baguette et une panoplie', 'Chef Bworkestre a besoin de prouver sa virilité à sa douce et tendre en demandant des kdô aux visiteurs de passage dans son charmant village. \nAvec une panoplie Prespic, il espère repousser les coups de rouleau à pâtisserie de sa bworkette d\'amour.', 45000, 35000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (332, 'Tonte matinale', 'Jicé est un type génial, il a compris qu\'avec de la laine on pouvait faire... de la laine', 120, 150, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (333, 'Montrer ses talents', 'Vos talents se développent mais tout le monde n\'en est pas convaincu.', 370, 0, '8536', NULL, 0);
INSERT INTO `quest_step` VALUES (334, 'Ailes en kit', 'Gobriel en a assez que les autres Gobelins lui jettent des pierres à cause de la couleur de sa peau. Il voudrait devenir un ange.', 30000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (335, 'Au travail', 'Allez demander au contremaître ce que vous devez faire.', 250, 250, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (336, 'Trouver la tanière de Bworkcine', 'C\'est là qu\'est retenue Gobrose.', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (337, 'Se remplir la panse', 'Bworkcine est prête à échanger son esclave contre son poids en bière bwork.', 12000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (338, 'Accorder le prétendant', 'Gobrose et Gobmichet vont ils se réunir ?', 0, 3000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (339, 'Plumer Gobrose', 'Gobmichet est jaloux des pious de Gobrose. Seul les vibrations de son petit coeur de gobelin vert doivent faire palpiter celui de Gobrose.', 3000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (340, 'Encore quelques palabres', 'Gobrose préfère être une esclave et élever des pious. Une triste réalité à apprendre à son prétendant...', 20000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (342, 'Une recette pour Pipelette', 'Pipelette attend la recette des crêpes d\'Astrub pour préparer la venue de ses petits enfants. ', 0, 75, '0', '1|3659;', 0);
INSERT INTO `quest_step` VALUES (343, 'Trouver un petit boulot', 'Posteur Ninh a surement une commission à vous confier. ', 50, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (344, 'Encore une livraison', 'Cette fois il faut porter un objet à un Xelor qui s\'occupe d\'un Zaap.', 150, 0, '0', '1|3666;', 0);
INSERT INTO `quest_step` VALUES (345, 'Relève de la garde', 'Disskray vous a demandé d\'aller contrôler que les gardes font bien leur travail.', 230, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (346, 'Arietta Fiolle', 'Allez voir où se trouve Arietta Fiolle.', 25, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (347, 'Je fais du social', 'Disskray veut savoir si les villageois n\'ont rien remarqué d\'étrange ou d\'inhabituel', 150, 0, '8535', NULL, 0);
INSERT INTO `quest_step` VALUES (348, 'Bienvenue', 'Bienvenue', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (349, 'Piou', 'Piou piou piou piou piou !', 250, 0, '6897,2;8537', NULL, 0);
INSERT INTO `quest_step` VALUES (350, 'Histoire d\'eau', 'Tenva Lakruche a besoin d\'eau pour ses nymphettes.', 75, 25, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (351, 'Le fil de l\'histoire.', 'Pour apprendre l\'histoire de l\'épée de Iop vous pouvez aller voir Tenva au temple.', 75, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (352, 'Transformation', 'Poss\'Ybel veut que vous lui fournissiez quelques produits finis issus du fruit de vos récoltes.', 50, 15, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (354, 'Combattre pour la garde.', 'Le capitaine vous a confié une tâche simple mais utile.', 195, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (358, 'Entraînement', 'Il faut faire perdre toute sa paille à un épouvantail animé.', 25, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (361, 'Carnets d\'adresse', 'Ajouter un joueur dans votre liste d\'amis.', 20, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (362, 'Reprendre forme', 'Aymé Tairnaile vous a transformé en fantôme, utilisez le phénix pour recouvrer vos forces.', 0, 0, '0', '40|194;', 0);
INSERT INTO `quest_step` VALUES (363, 'Osons l\'Osa !', 'Cet Osa vaniteux mérite une bonne correction !', 500, 0, '8534', NULL, 0);
INSERT INTO `quest_step` VALUES (364, 'Conditions d\'échange', 'Anta vous a fait une liste de ce qu\'elle veut en échange de son collier magique.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (365, 'La clef entre les dents', 'Si tu veux la clef du donjon, il faut battre un gros bouftou hargneux.', 55, 0, '8545', '1|3815;', 0);
INSERT INTO `quest_step` VALUES (366, 'Se mettre en bière', 'Aymé veut de la bière, pourquoi ne va-t-il pas la chercher tout seul ?', 15, 10, '0', '1|3814;4|-2;', 0);
INSERT INTO `quest_step` VALUES (367, 'Licence quatre', 'Vous avez la bière, en la donnant à Aymé, vous devriez recouvrer toute votre énergie.', 0, 0, '0', '1|3817;', 0);
INSERT INTO `quest_step` VALUES (368, 'Combattre pour la garde.', 'Le capitaine vous a confié une tâche simple mais utile.', 195, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (369, 'Combattre pour la garde.', 'Le capitaine vous a confié une tâche simple mais utile.', 195, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (370, 'Combattre pour la garde.', 'Le capitaine vous a confié une tâche simple mais utile.', 195, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (371, 'Il est à qui le Kiki ?', 'Ma\'Ster vous a mis au défi de battre le monstre tapi dans sa niche.', 0, 0, '0', '1|3830;', 0);
INSERT INTO `quest_step` VALUES (372, 'Trouver de la ouache.', 'Malgré un accent prononcé vous avez saisi la demande de Marylork.', 75, 75, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (373, 'Lykhen radote', 'Lykhen raconte sa vie d\'ancien aventurier.', 10, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (374, 'Titi a sa bourse d\'étude.', 'Bworknroll a accepté d\'enseigner la magie à Titi. Annoncer la nouvelle à son père.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (375, 'Comme vous avez de grandes dents.', 'Un Mulou vous fait une proposition alléchante.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (376, 'Inscription.', 'Si Bworknroll accepte le paiement, Titi pourra devenir mage.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (378, 'Transformation', 'Poss\'Ybel veut une mini potion de soins faite d\'une fleur de lin et d\'un peu d\'eau.', 50, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (379, 'Transformation', 'Poss\'Ybel veut que vous lui fournissez quelques produits finis issus du fruit de vos récoltes.', 50, 15, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (380, 'Transformation', 'Poss\'Ybel veut que vous lui fournissez quelques produits finis issus du fruit de vos récoltes.', 50, 15, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (381, 'Au travail', 'Allez demander au contremaître ce que vous devez faire.', 250, 250, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (382, 'Au travail', 'Allez demander au contremaître ce que vous devez faire.', 250, 250, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (383, 'Au travail', 'Allez demander au contremaître ce que vous devez faire.', 250, 250, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (384, 'Trouver le Sram.', 'Yse Vewybad vous a parlé d\'un Sram important en Amakna... Où trouve-t-on des Srams en Amakna?', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (385, 'Trouver le repaire des Roublards.', 'Yse Vewybad vous a donné des indications sur la position des Roublards. Allez donc voir du côté du cimetière.', 9000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (386, 'La crypte, c\'est chic.', 'Vous devez visiter les cinq cryptes du cimetière d\'Amakna.', 3000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (387, 'Ca roule pour les Roublards.', 'Vous avez maintenant une idée très précise de la cachette des Roublards. Reste à vérifier vos informations.', 2000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (388, 'Pour quelques Roublards de plus...', 'Vous devez vous inflitrer chez les Roublards et aller parler à Vil Smisse.', 15000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (390, 'Dilemme dilemme..', 'Vous savez maintenant qu\'Yse Vewybad complote contre le Roi. Il va falloir prendre parti pour l\'un ou l\'autre.', 2000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (394, 'Trouver le prétendant.', 'Il vous faut trouver un prétendant pour Allisteria, la fille du frère du roi.', 15000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (395, 'A la pêche aux infos.', 'Vil Smisse veut que vous recueillez des renseignements sur ce qui se prépare au château. Il faut donc trouver la personne qui saura vous dire ça.', 3000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (396, 'Chercher la petite bête.', 'Maintenant, vous savez que le roi doit marier sa nièce... mais avec qui?', 12000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (399, 'Wabbit powa', 'Trouver un moyen de se tranformer en Wabbit.', 10000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (400, 'Et une formule, une!', 'Vous devez retrouver des alchimistes disséminés en Amakna.', 15000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (401, 'Après la recette, les ingrédients.', 'Maintenant qu\'Uba a la formule, il ne lui manque plus que les ingrédients.', 25000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (402, 'Fausse identité', 'Comme vous pouvez le voir, Uba Tessé vous a transformé en Wabbit. Il n\'y a plus qu\'à aller voir au château si vous pouvez faire capoter ce mariage.', 50000, 25000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (403, 'Un oeuf tout neuf', 'Vil Smisse vous a demandé de lui rapporter un oeuf de tofu obèse. Encore faut-il trouver le nid...', 5000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (404, 'Gavage', 'Vous avez l\'oeuf de Tofu obèse, mais un oeuf ne va pas faire grand mal au pwince... Il faut trouver de quoi gaver l\'oisillon à naître.', 40000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (405, 'Un cadeau empoisonné', 'Vil Smisse a décidé d\'éviter l\'approche directe et de faire les choses plus à la façon traditionnelle des Roublards - sournoisement.', 10000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (406, 'Tueurs à gage à engager', 'Vil Smisse ne pourra utiliser le blopisier empoisonné. Il se rabat donc sur l\'attaque de front. Pour cela, il veut engager des assassins, il a donc besoin d\'argent.', 76000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (407, 'Trouble-fête', 'Les assassins ont échoué à tuer le prince... Vil Smisse vous demande d\'aller engager un Lenald pour le trucider.', 140000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (408, 'Sus au tofu!', 'Vous savez où le pwince d\'Wa est parti chasser, enfin à peu près... c\'est au sud de Bonta en tout cas. Reste à trouver ce fameux pwince.', 100000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (409, 'Qui m\'aime me suive!', 'Le pwince d\'Wa vous a demandé de lui constituer une suite digne de sa stature... Vu ses prouesses au combat, son régime particulier et son sens de l\'esthétisme, il faut bien quatre personnes pour l\'assister.', 45000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (414, 'Servir ou rendre service?', 'L\'intendant San Lavalss vous demande d\'aider aux derniers préparatifs du mariage.', 86000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (415, 'Au meurtre!', 'Le pwince d\'Wa se fait attaquer, protégez-le!', 5000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (416, 'Bunny suit', 'Le pwince d\'Wa vous a demandé de prendre sa place pour démasquer les assassins. Encore faut-il trouver quelqu\'un qui puisse vous tranformer en Wabbit.', 15000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (417, 'Courses', 'Maintenant que la formule est complète, il faut les ingrédients.', 120000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (418, '1er étape', 'test', 0, 0, '8359,10;376,10;8141,10;8141,10;2087,10', NULL, 0);
INSERT INTO `quest_step` VALUES (420, 'Un déguisement pour Emeraude', 'Emeraude cherche désespérément une panoplie Koalak.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (421, 'Répondre au questionnaire', 'Le Gardien du Pont de la Mort exige que vous répondiez correctement à ses questions.', 30000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (422, 'Bien préparer son voyage', 'Le Capitaine Kradoc a besoin que vous lui rapportiez plusieurs objets pour qu\'il puisse vous emmener dans son bateau.', 30000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (423, 'Le Coffret Maudit du Flib', 'Le bateau du Capitaine Kradoc s\'est lamentablement échoué sur l\'île des naufragés. Vous devez retrouver le Coffret Maudit du Flib et quelques objets pour réparer le bateau.', 30000, 2500, '0', '1|4133;', 0);
INSERT INTO `quest_step` VALUES (424, 'Vous ne passerez pas !', 'Le Chevalier Noir et Rose est fermement décidé à ne pas vous laisser passer. C\'est peut-être le bon moment d\'employer la force.', 45000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (425, 'Une potion pour le professeur', 'Le Professeur Fournesol a besoin d\'une Potion Bulbique pour se remettre au travail.', 30000, 1000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (426, 'Les machines d\'élevage', 'Polka Merer a besoin de machines d\'élevage pour ses créatures.', 30000, 2000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (427, 'Une histoire de farines', 'Paulette Pain-bèche la boulangère a l\'intention de recouper sa farine de Xavier le Boulanger avec différentes farines bon marché. Elle a eu l\'idée, à vous de trouver les farines !', 30000, 1500, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (428, 'A la recherche du fils caché', 'Le Docteur Nauh a perdu son fils dans un laboratoire infesté de terribles créatures sauvages. Vous devez le retrouver et vous assurer qu\'il est encore en vie !', 30000, 1000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (429, 'Le docteur est morose', 'Le pauvre Docteur Morose a perdu sa femme. Aidez-le à la trouver dans la Jungle Sombre et tentez de la persuader à retrouver son mari pour qu\'il puisse reprendre ses recherches.', 30000, 1000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (430, 'L\'équipement amélioré', 'Spitte Fayeur recherche un casque et une cape de pilote améliorés. Seul un tailleur expérimenté pourra vous aider.', 30000, 4000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (431, 'Deux Dragodindes pour Flip Flap', 'Flip Flap voudrait que vous lui rameniez un certificat de Dragodinde Rousse ainsi qu\'un certificat de Dragodinde Amande.', 30000, 30000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (432, 'Chasse sur la plage', 'Crocodaille Dandi aimerait que vous éliminiez certaines créatures sur la plage de Corail.', 50000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (433, 'Chasse dans les Plaines', 'Crocodaille Dandi aimerait que vous chassiez pour lui plusieurs créatures des Plaines.', 150000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (434, 'Chasse dans la Tourbière sans fond', 'Crocodaille Dandi aimerait que vous chassiez pour lui quelques créatures de la Tourbière sans Fond.', 250000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (435, 'Chasse dans la Jungle Sombre', 'Crocodaille Dandi aimerait que vous chassiez pour lui quelques créatures de la Jungle Sombre.', 250000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (436, 'Chasse dans l\'Arbre Hakam', 'Crocodaille Dandi aimerait que vous chassiez pour lui quelques créatures de l\'Arbre Hakam.', 500000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (437, 'Un exemple pour les Pirates', 'Kito vous a demandé de faire un exemple pour les Pirates qui lui lancent des boulets.', 30000, 1000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (438, 'Le Chevalier Noir et Rose', 'Peggy la Porkass aimerait que vous affrontiez le terrible Chevalier Noir et Rose à sa place.', 30000, 2000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (440, 'L\'échange maudit', 'Farle Ingalsse est sûrement la seule personne d\'Amakna capable de rendre utilisable cette épée maudite...', 0, 0, '8992', NULL, 0);
INSERT INTO `quest_step` VALUES (442, 'La tour désordre.', 'Trouvez dans Bonta un personnage important qui serait susceptible d\'être corrompu. Oto a suggéré de chercher dans la tour.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (443, 'Retour de la tour.', 'Vous avez trouvé un morceau de papier très intéressant. Il faut le montrer à Oto.', 60000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (444, 'Les bons bars de Bonta.', 'Il faut trouver des informations sur Xephirès. Les taverniers de Bonta pourraient peut-être fournir une piste.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (445, 'Abrakadabra, me voilà.', 'Vous avez rapporté des informations utiles à Oto Mustam, qui vous a demandé de prendre la relève d\'un milicien. Vous devez chercher un Sram connaissant Xephirès, dans la forêt des Abraknydes.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (446, 'Abrakadabra, c\'est encore moi.', 'Exoram n\'est pas rassuré car il a entendu des bruits suspects et des rires narquois plus au nord. Si vous pouvez lui assurer que le chemin est dégagé, il vous donnera les informations prisées sur Xephirès.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (447, 'S\'infiltrer ou foncer dans le tas, telle est la question.', 'D\'après vos découvertes, il semblerait qu\'Exoram soit retenu prisonnier dans le campement gobelin sauf s\'il est déjà mort.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (448, 'Sur les traces du Sram.', 'Exoram a été relâché vivant par les gobelins. Vous devez à nouveau partir sur ces traces pour lui mettre la main dessus.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (449, 'Le repaire repéré.', 'Grâce au message du chef des voleurs vous êtes en mesure de trouver son repaire. Pourquoi ne pas y faire un tour avant de rentrer à la milice ?', 90000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (451, 'La rencontre.', 'Maintenant que l\'endroit où Xephirès se trouve a été identifié, il faut le trouver à la taverne du Pandawa Ivre et lui faire la proposition. Il y est à partir de 16 heures.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (452, 'Un échec... temporaire', 'Xephirès a refusé l\'offre, mais tout n\'est pas perdu. Un bijou saura l\'amadouer.', 75000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (453, 'De la bave pour confectionner un bijou ?', 'Vous devez récupérer des matériaux pour confectionner un joyau : 5 Lingots d\'Or, 1 Bave du Bouftou Royal et 1 Nacre. La Nacre s\'obtient en polissant 10 Nacres brutes que l\'on trouve sur les crustacés et mollusques de l\'île d\'Otomaï.', 80000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (455, 'L\'enlèvement de Sabine.', 'Vous devez enlever Sabine et la mettre dans un endroit d\'où elle ne pourra pas s\'échapper.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (456, 'Vite, vite !', 'Milone serait apparemment sur le point d\'être cambriolé. Il faut vite aller empêcher cela.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (457, 'Des getas pour Milone.', 'Pour vous punir de ne pas avoir pu empêcher les voleurs de dérober le bijou, Milone vous a demandé de lui amener des Getas Feudala.', 90000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (458, 'Le facteur.', 'Il faut trouver un moyen de faire passer la lettre à Xephirès. Il est souvent à la taverne du Pandawa Ivre mais refuse désormais de vous parler.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (459, 'L\'entretien.', 'Tout est prêt, il ne reste plus qu\'à retrouver Xephirès à la Taverne du Pandawa Ivre pour lui remettre la lettre et fixer un rendez-vous pour sa réponse.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (460, 'Victoire !', 'Xephirès a accepté les conditions et est prêt à trahir Bonta le moment venu. Oto sera satisfait d\'apprendre la nouvelle.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (461, 'Renseignements à la Bagrutte', 'Le marchand de vin local a disparu. Le tavernier de la Bagrutte a peut-être des renseignements.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (462, 'Enquête à l\'Est.', 'D\'après le tavernier Bagrutte, le marchand avait l\'habitude de rentrer chez lui, un peu plus à l\'Est.', 60000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (463, 'Tournée des tavernes.', 'Le bandit à qui appartenait l\'épée est probablement passé dans l\'une des tavernes. Par conséquent, les taverniers doivent savoir quelque chose.', 65000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (464, 'Repaire pépère.', 'Amayiro vous a demandé d\'enquêter dans les plaines de Cania pour trouver le repaire des bandits. D\'après vos informations il serait non loin de la foire du trooll, un peu à l\'Ouest.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (465, 'Jolie minette.', 'Votre rencontre avec les bandits vous a appris que Hersa Griffe Sombre en sait plus qu\'elle ne veut l\'admettre. Reste à lui parler sans se faire défigurer.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (466, 'Escorte Gueurle.', 'Votre mission est d\'escorter la troupe de marchands de Gueurle jusqu\'à Astrub.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (468, 'Piège pour Ecaflips.', 'Amayiro veut tendre une embuscade aux bandits, pour cela il a besoin d\'un bijou de grande valeur afin de les attirer dans son piège.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (469, 'Mauvais hameçon ?', 'Le voyage s\'est passé sans encombre. Les bandits n\'ont pas attaqué... Amayiro attend votre rapport.', 75000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (470, 'Au rapport.', 'Le convoi a été attaqué par des bandits Ecaflips semblables à ceux dont vous avez découvert le campement. Amayiro attend votre rapport pour convaincre le conseil d\'agir.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (472, 'Pour vivre, il faut des vivres.', 'Sous la pression du conseil, Amayiro vous a retiré l\'enquête et vous êtes désormais de corvée de ravitaillement.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (473, 'Une bonne Rigalade', 'Rigal Main Crochue, au temple Sram, est réputé pour détenir de nombreuses informations, mais toute information à un prix. Reste à savoir à combien s\'élève la vôtre.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (474, 'Il est frais mon poison.', 'Vous devez trouver les réserves de poison de Brâkmar et dérober le registre des clients de l\'atelier des alchimistes. Bishom Pot pourra peut-être vous aider.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (475, 'Affaire louche.', 'Vous allez profiter de l\'absence de Xarthan pour vous introduire discrètement dans sa maison et la fouiller. Les services d\'un bricoleur compétent seront nécessaires.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (476, 'Bishom Pot, le retour.', 'Amayiro soupçonne Brâkmar d\'être à l\'origine des problèmes de Bonta. Bishom Pot, espion milicien à Brâkmar, a peut-être appris quelque chose.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (477, 'Le vieux bijoutier.', 'Selon le chef des voleurs, le bijoutier de Brâkmar - Milone Corichel - aurait des informations.', 100000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (478, 'Attrape-nigaud.', 'Un rendez-vous entre un Brâkmarien et le Bontarien corrompu va avoir lieu à la tour de Bonta. Il faut les capturer tous les deux si possible.', 105000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (479, 'Escarmouche.', 'Un combat a actuellement lieu près de la Baie de Cania, sur la route à mi-chemin entre Bonta et Brâkmar. Il faut le rejoindre et aider Brâkmar à vaincre !', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (480, 'Retour vers Oto.', 'La bataille est terminée, Oto Mustam attend votre rapport.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (481, 'Kaffra Kyper.', 'Oto Mustam veut avoir l\'avis de Kaffra Kyper pour son offensive contre Bonta.', 110000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (482, 'En territoire ennemi.', 'Vous devez vous infiltrer dans le bâtiment de la milice de Bonta et découvrir où vos ennemis entreposent leurs armes.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (483, 'Une bien belle grosse caisse.', 'Vous devez tromper la vigilance du gardien pour lui prendre les clefs de l\'entrepôt. Il vous faut ensuite dérober une caisse d\'équipement et l\'apporter à Mulic Bere pour expertise.', 116000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (485, 'Récolte de poison.', 'Les espions à Bonta ont besoin de poison : un poison rare détenu uniquement par les Bworks Mages. Les espions se cachent dans le quartier sud-ouest de Bonta.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (486, 'Assassinat.', 'Vous pouvez maintenant entrer dans la bibliothèque pour vous occuper du tacticien.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (487, 'Pénétrer dans la bibliothèque.', 'Les espions à Bonta ont échoué dans leur assassinat, il faut donc le faire à leur place. La cible est un tacticien qui réside dans la bibliothèque de Bonta mais gare aux chiens de garde.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (488, 'Retour vers Oto', 'Vous vous êtes occupé du tacticien, il faut retourner voir Oto.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (489, 'Retour vers Oto.', 'Le tacticien ayant quitté la ville, vous pouvez raisonnablement laisser penser à Oto Mustam que vous l\'avez tué.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (490, 'Jusqu\'à Brâkmar.', 'Le tacticien a accepté de vous suivre jusqu\'à Brâkmar.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (491, 'Nouveau danger qui fait peur.', 'Plusieurs guerriers brâkmariens ont été vaincus et laissés pour morts sur la route menant à Astrub. Il faut aller enquêter là-bas mais avant, Oto Mustam veut une âme de Croc Gland.', 140000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (492, 'Marteau et enclume.', 'Oto Mustam pense que Bonta est aidée par un forgeron mercenaire. Vous devez chercher dans les ateliers de forgerons ou de mineurs pour trouver des indices.', 146000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (493, 'Dans la grotte Porcos.', 'Vous devez tenter de rallier le forgeron de la grotte Porcos à la cause de Brâkmar.', 152000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (494, 'Interception brutale.', 'Vous devez intercepter un convoi d\'armes qui va passer par l\'orée de la Forêt des Abraknydes pour rejoindre le Village des Brigandins. Des renforts seront les bienvenus.', 158000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (495, 'Pirate à quai.', 'Grâce à Xephirès, vous savez que le navire bontarien La Descemer transporte de nombreux objets magiques dans ses cales. Vous devez le trouver et faire main-basse sur sa marchandise.', 164000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (496, 'Escarmouche.', 'Un combat a actuellement lieu près de la Baie de Cania, sur la route à mi-chemin entre Bonta et Brâkmar. Il faut le rejoindre et aider Bonta à vaincre !', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (497, 'Au rapport.', 'La bataille est terminée, Jerhyn Gholein attend votre rapport.', 110000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (498, 'Forger avec ses pieds.', 'Vous devez enquêter sur le fournisseur de l\'équipement de la milice et mettre à l\'épreuve le forgeron qui le fabrique.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (499, 'Ainsi forgeront...', 'Il faut trouver un forgeron compétent qui accepterait de faire de l\'équipement pour Bonta.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (500, 'Si près du but.', 'Norb sait où se trouve le forgeron ermite, il vous reste à le convaincre de divulguer sa cachette. Peut-être qu\'Amayiro pourra vous aider.', 122000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (501, 'Prospection immobilière.', 'Nara vous a demandé de trouver un endroit isolé où installer sa forge et son matériel.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (502, 'Lenglad en prend pour son grade.', 'William Lenglad a de nouveau besoin d\'une leçon.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (503, 'Matières premières.', 'Nara le forgeron, dans la mine du territoire Porcos, a besoin de matières premières pour forger un équipement standard destiné aux miliciens de Bonta.', 140000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (504, 'Danathor, qu\'est-ce que tu nous mijotes encore ?', 'Danathor semble avoir une nouvelle offre à vous faire. Probablement quelque chose de louche.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (508, 'Sadikoi ?', 'Danathor a encore besoin de vos services pour mettre la main sur le grimoire du bwork mage des cavernes réputé pour avoir lancé l\'envoûtement de la Grafioze.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (509, 'Vol dans un nid de coucou.', 'Amayiro veut tendre une embuscade aux Brâkmariens pour tester le nouveau matériel et la cohésion des miliciens.', 152000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (510, 'Plan d\'attaque.', 'Amayiro craint un assaut imminent des Brâkmariens. Vous devez trouver leur plan d\'attaque pour permettre à Amayiro de leur préparer un comité d\'accueil digne de ce nom.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (512, 'Sufokia.', 'Une rumeur affirme qu\'il existe une corne disposant de puissants pouvoirs magiques. Les habitants de Sufokia auraient des informations supplémentaires.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (513, 'Carapaces de tortue.', 'Le tavernier du Ripate veut que vous lui apportiez des carapaces de tortue de Moon, une de chaque couleur, mais peut-être qu\'une grosse somme de Kamas pourrait les remplacer.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (514, 'C\'est l\'or, Moon.', 'Le soi-disant gardien de la Corne Edfrit serait dans la jungle profonde de l\'île de Moon. D\'après les rumeurs, vous devez porter une Fourbacoiffe et avoir du Gloutoburg pour qu\'il apparaisse.', 177000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (515, 'Amadoudoudou c\'est bon.', 'Il faut trouver un moyen d\'amadouer Turorte pour mettre la main sur la Corne Edfrit. Les résidents de l\'île de Moon peuvent vous aider.', 184000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (516, 'Lenseignements auplès des Lenalds.', 'Turorte a côtoyé et défendu les Lenalds par le passé. Les Lenalds, au sud de l\'île des Wabbits, s\'en souviennent peut-être encore.', 191000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (519, 'L\'espion blessé.', 'Vous devez rattraper l\'espion blessé qui fait route vers Brâkmar et lui reprendre les documents. \nCependant, vous avez trouvé une lettre dans votre sac...', 205000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (520, 'Course contre la montre.', 'Un espion bontarien est en train de fuir Brâkmar par l\'Est de la route. Il faut le retrouver et l\'escorter. Le temps vous est compté !', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (521, 'Récupération mouvementée.', 'Vous avez trouvé l\'espion à temps mais les Brâkmariens ne comptent pas vous laisser les documents. Il vous faut les amener à Amayiro coûte que coûte.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (523, 'Assaut sur le château du Wa.', 'Vous devez récupérer le bandana de Turorte, qui est détenu par les Wobots dans le donjon du Wa Wabbit.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (524, 'La décision de Turorte.', 'Convaincre Turorte d\'échanger le Bandana Rapiécé contre la Corne Edfrit. Vous avez besoin d\'une Fourbacoiffe et d\'une Bouteille de Gloutoburg pour qu\'elle vous apparaisse.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (525, 'Présence brâkmarienne.', 'Vous avez attaqué un Brâkmarien qui était déjà sur place mais qui ne possédait pas encore la Corne Edfrit. Si Ecaflip est de votre côté peut-être trouverez-vous la Corne Edfrit avant les Brâkmariens.', 219000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (526, 'Le Mage Ax.', 'Amayiro vous a demandé d\'interroger le Mage Ax pour connaître le mode d\'emploi de la Corne Edfrit et ses pouvoirs.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (527, 'Une autre histoire de poivrot.', 'D\'après vos sources, le tavernier de Sufokia aurait des informations sur une puissante corne magique.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (528, 'Carapaces.', 'Le tavernier du Ripate vous a demandé une carapace de tortue de Moon de chaque couleur. Mais peut-être allez-vous opter pour une méthode plus rapide.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (529, 'Recherches pour une corne.', 'Le soi-disant gardien de la Corne Edfrit serait dans la jungle profonde de l\'île de Moon. D\'après les rumeurs, vous devez porter une Fourbacoiffe et avoir du Gloutoburg pour qu\'il apparaisse.', 177000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (530, 'Mettre la tortue sur le dos.', 'Puisque vous n\'arrivez pas à soutirer des informations juste en demandant, il va falloir y aller d\'une façon plus directe...', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (531, 'L\'ami des bêtes.', 'Vous devez trouver d\'où vient Turorte. Un spécialiste des animaux pourra vous aiguiller dans vos recherches. Oshimo, responsable du chanil, est un bon point de départ.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (532, 'La forge de luxe.', 'Il faut fabriquer un grattoir à dos que Turorte puisse utiliser. Etant le meilleur forgeron de Brâkmar, Mulic Bere pourra vous aider à réaliser cet outil particulier.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (533, 'Retrouver l\'espion.', 'Vous devez rapidement retrouver l\'espion blessé sur la route menant à Bonta, et récupérer les documents. L\'espion doit être plus proche de Bonta que de Brâkmar.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (534, 'Le choix.', 'Vous avez trouvé l\'espion à temps. Mais allez-vous suivre les ordres et récupérer les documents en le laissant là ?', 205000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (535, 'Un petit échec.', 'Des traces de combat, deux armes laissées au sol, un Sram décédé : tout porte à croire que vous n\'êtes pas arrivé à temps.', 205000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (536, 'Attraper l\'espion.', 'Un espion bontarien s\'est infiltré dans la tour et a volé des documents. Il faut utiliser un Zaap pour l\'intercepter, à l\'Est de la route menant à Bonta, du côté de Brâkmar.', 212000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (537, 'L\'art de cuisiner sans se fatiguer, ou presque.', 'Vous devez trouver les recettes des ingrédients listés sur le papier remis par Oto Mustam.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (538, 'Ratatouille.', 'Il faut réunir les ingrédients nécessaires dans le chaudron primordial : un objet de chaque type et un alchimiste, un boulanger, un paysan, un boucher, un poissonnier.', 219000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (539, 'Le côté obscur du wabbit.', 'Vous devez négocier l\'emplacement de la Corne Edfrit contre un Grattoir à dos Spontex auprès de Turorte, mais qui c\'est ce qui vous attend dans la jungle profonde de Moon ?', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (540, 'La fourfouille.', 'Turorte vous a révélé que la Corne Edfrit était enterrée au nord-est de l\'île, près d\'une statue de phénix.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (541, 'Le trouble-fête.', 'Vos fouilles ont été interrompues par l\'arrivée d\'un Sadida. A vous de lui montrer ce qu\'il arrive lorsqu\'on ose s\'opposer à Brâkmar.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (542, 'Disparition.', 'Vous pouvez à présent finir vos recherches et faire votre rapport à Oto Mustam.', 226000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (544, 'Equiper les guerriers.', 'Oto craint une attaque de Bonta et vous a demandé d\'équiper certains des guerriers de Brâkmar avec de l\'équipement spécial.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (572, 'Des personnes de confiance.', 'Amayiro a besoin de personnes de confiance pour participer à la mise en scène des faux pouvoirs de la Corne Edfrit.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (573, 'Une mise en scène minutieuse.', 'Pour finaliser la mise en scène, Amayiro a besoin de Miteters présentes sur des Craqueleurs et de la Graisse de Gelée Royale, n\'importe laquelle fera l\'affaire.', 233000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (679, 'Battre le milicien.', 'Vous devez battre Tarche le milicien, dans la salle à côté.', 50, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (680, 'Interroger la Dame.', 'Vous devez aller voir Dame Cloude pour lui demander ce qu\'il se passe.', 125, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (681, 'Donner des pains.', 'Vous devez apporter 20 pains au blé complet à Amayiro.', 250, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (682, 'Les dents de Bouftou.', 'Vous devez arracher des dents de Bouftous, exactement le nombre constituant un dentier humain, et les amener à Ned, au sud-ouest de la ville.', 500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (683, 'Une tatanne pour le frérot.', 'Vous devez battre le milicien Torche et ramener une preuve à Amayiro.', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (684, 'Visite chez le tavernier.', 'Vous devez récupérer la carte d\'Amayiro et une bière auprès du tavernier Feubuk.', 1500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (685, 'Retrouver le Corbac.', 'Vous devez retrouver le Corbac qui a volé le collier de la fille du maire, le battre et récupérer le collier. Le Corbac serait vers la tour.', 2000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (686, 'Traquer les buveurs.', 'Vous devez faire le tour des tavernes de Bonta pour trouver les miliciens qui ne sont pas à leur poste et leur demander leur badge.', 2500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (687, 'Trouver la faille.', 'Vous devez trouver quelque chose d\'intéressant sur les engrenages de la grande porte de Brâkmar.', 3000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (688, 'Chasse au sanglier.', 'Vous devez trouver le sanglier agressif au sud de Bonta et le battre.', 3500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (689, 'Entraînement au bâton.', 'Amayiro vous a demandé vingt bâtons de boisaille pour entraîner ses troupes.', 4000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (690, 'Tabasser le mauvais payeur.', 'Le tavernier Tabasse doit une forte somme à Amayiro : vous devez le convaincre par tous les moyens de la payer.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (691, 'La réparation du katana.', 'Vous devez demander à Kosuke le forgeron de réparer la lame d\'Amayiro en échange du chèque.', 4600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (692, 'Communiquer avec l\'espion.', 'Vous devez trouver Bishom Pot dans Brâkmar et lui soutirer les informations qu\'Amayiro a demandées.', 5200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (693, 'Apporter la poudre.', 'Vous devez apporter dix pods de poudre à canon à Amayiro. Vous pourrez les acheter à Moub Reicifitra, dans Bonta.', 5800, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (694, 'Colmater la brèche.', 'Shere Hacanon, à l\'entrée de Bonta, a besoin de quatre pierres de Craqueleur des plaines pour colmater la brèche des murailles.', 6400, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (695, 'Transport de caisses.', 'Vous devez acheminer quatre caisses entre Amayiro et l\'avant-poste de Bonta, au sud de la cité.', 7000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (696, 'Collection de casques.', 'Vous devez amener 15 casques de Chafers d\'Elite à Amayiro.', 7600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (697, 'Enquête sur la foire.', 'Il faut chercher un formulaire auprès de Ture Inge, dans la milice, puis interroger le chef de la foire du Trool afin de détecter s\'il est un Brâkmarien ou non.', 8200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (698, 'De la bouillie pour le Tabi.', 'Apporter de la bouillie de fleurs de blops à Amayiro. Pour obtenir cette bouillie, il faut concasser quatre fleurs de blops de couleurs différentes dans un Concasseur Munster.', 8800, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (699, 'Les informations du capitaine.', 'Vous devez trouver un moyen pour entrer en communication avec feu le capitaine Tsog, afin d\'obtenir les informations qu\'il doit faire passer. Le capitaine Alrok connait l\'emplacement de la tombe de Tsog.', 9400, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (700, 'De l\'agilité pour Amayiro.', 'Amayiro vous a demandé vingt anneaux d\'agilité.', 10000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (701, 'L\'invocation inconnue.', 'Amayiro vous a demandé de vous renseigner auprès de Zeurg (maître de classe Osamodas) à propos d\'une invocation inconnue employée par Brâkmar.', 10700, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (702, 'Amener les capes.', 'Amayiro vous a demandé d\'apporter 10 capes bontariennes au capitaine Koda, à côté. Elles se confectionnent avec une teinture magique bleue, une plume de corbac et une laine de boufton blanc.', 11400, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (703, 'Patate chaude.', 'Vous devez peler 200 pods de patates et les amener au cuisinier de la milice.', 12100, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (704, 'A la rescousse de Lyeno.', 'Vous devez sauver le colonel Lyeno : il a disparu dans la partie Est de la forêt des Abraknydes.', 12800, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (705, '21 heures.', 'Danathor vous a demandé de le retrouver à 21 heures avec les ingrédients indiqués sur sa liste.', 13500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (707, 'Assassinat refusé.', 'Retournez voir Amayiro.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (708, 'De la viande pour le cuisinier.', 'Le cuisinier de la milice de Bonta, Rei Nisuc, a besoin de 10 cuisses de Tofu.', 13500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (709, 'Un champo pour Amayiro.', 'Amayiro vous a demandé de lui apporter un Champo ordinaire. Vous en trouverez sur les Maîtres Bolets.', 14200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (710, 'Trouver le coupable.', 'Trouvez l\'assassin de Rimaraf et amenez le formulaire rempli à Amayiro.', 14900, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (711, 'Fausses preuves.', 'Trouvez un moyen de berner Amayiro en lui montrant des fausses preuves. Danathor pourra sans doute vous y aider.', 14900, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (712, 'Amener le venin.', 'Le capitaine Essacarf, dans la prison de Bonta, a besoin de 30 pods de venin de scorbute.', 15600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (713, 'Combat... pour rire.', 'Vous devez trouver Dike Tarak dans le quartier nord, le défier, et perdre.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (714, 'Combat... pour rire ?', 'Vous devez trouver Dike Tarak dans le quartier, le défier et le battre.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (715, 'Activités illicites.', 'Des évènements louches se trament dans le quartier des boulangers. Amayiro vous a demandé d\'enquêter.', 17000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (716, 'Trouver une faille.', 'Amayiro vous a demandé d\'explorer le Cimetière des Torturés, à l\'Est de Brâkmar, et de voir s\'il y a une faille dans les défenses de la cité. Vous aurez sûrement besoin de matériel particulier.', 19000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (717, 'Travail au choix.', 'Vous devez apporter à Amayiro : soit 20 planches en frêne, soit 10 racines d\'Abraknyde.', 21000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (718, 'Une requête de Danathor.', 'Danathor vous a envoyé une lettre pour vous demander assistance.', 11500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (719, 'Larry Poller.', 'Larry Poller a demandé votre aide. Il se trouve près de la tour de Bonta.', 11500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (720, 'Le tabi de Grace.', 'Grace Malcean, dans Bonta, a des problèmes avec son tabi.', 25000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (721, 'Raid chez Brâkmar.', 'Amayiro vous a demandé de vaincre des guerriers brâkmariens et de récupérer dix badges sur eux.', 28000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (722, 'Une autre demande du cuistot.', 'Le cuisinier de la milice a de nouveau demandé vos services.', 31000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (723, 'Une leçon à donner.', 'Un certain William Lengland perturbe les habitants de Bonta : il faut aller le calmer, par la force.', 34000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (724, 'Dans les geôles de Brâkmar.', 'Amayiro vous a demandé de sauver Houé Dapyus, dans la prison de Brâkmar, et de le ramener à la milice bontarienne.', 37000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (725, 'Le sang des rats.', 'Amayiro vous a demandé d\'anéantir quatre Rats d\'Hyoactif dans les égoûts de Bonta.', 40000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (726, 'Désosser Mak.', 'Battez Mak Gahan le Chafer et amenez un de ses os à Oto Mustam.', 50, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (727, 'Offre d\'emploi.', 'Oto Mustam veut savoir qui a assassiné le patron de la Taverne du Chabrulé.', 125, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (728, 'Des potions énergétisantes.', 'Oto Mustam a besoin de trois potions Pahoa Raide.', 250, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (729, 'Un nouveau dentier.', 'Vous devez arracher des dents de Bouftou pour confectionner un dentier. Vous devez en amener exactement assez pour faire un dentier d\'humain... enfin, d\'humanoïde.', 500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (730, 'Redésosser Mak Gahan.', 'Mak Gahan le Chafer veut sa revanche.', 1000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (731, 'Amener les caisses.', 'Il faut amener à Oto les caisses d\'armes blanches qui se trouvent dans la tour de Brâkmar.', 1500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (732, 'Une clé sur un écureuil.', 'Vous devez retrouver un écureuil dans Brâkmar : il a volé une clé importante. Rapportez-la à Oto.', 2000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (733, 'Enquête importante.', 'Faites le tour des gardes de Brâkmar et réalisez un compte-rendu des gardes qui ne prennent pas de pause.', 2500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (734, 'Tabasser les Bontariens.', 'Oto vous a demandé une bière de la Tabasse. La taverne de la Tabasse se trouve à Bonta.', 3000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (735, 'Entraînement au marteau.', 'Oto a besoin de dix Marteaux de Boisaille pour l\'entraînement de ses troupes.', 3500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (736, 'Un message à faire passer.', 'Oto veut que vous passiez son message à Vil Smisse, dans le repaire des Roublards qui se situe dans le cimetière d\'Amakna.', 4000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (737, 'La récolte de poison.', 'Oto Mustam a besoin de 20 pods de venin de Scorbute.', 4600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (738, 'Le rapport de l\'espion.', 'Oto vous a demandé de trouver l\'espion Finche Aticus, à Bonta, et de lui demander son rapport.', 5200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (739, 'La relève.', 'Vous devez trouver le guerrier Tink Berval et lui demander de relever Brank Thoof.', 5800, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (740, 'Les casques de Chafer.', 'Oto veut dix casques de Chafer qu\'on trouve au Cimetière des Torturés.', 6400, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (741, 'Chasse au loup.', 'Oto vous a demandé de débarrasser Brâkmar d\'un loup qui rôde autour de la façade.', 7000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (742, 'La bouillie de blops.', 'Il faut apporter de la bouillie de blop concassés à Oto. Il peut vous donner la recette.', 7600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (743, 'A la recherche de poison magique.', 'Vous devez trouver quelqu\'un dans Brâkmar qui sache préparer des poisons magiques.', 8200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (744, 'Les capes brâkmariennes.', 'Oto vous a demandé cinq capes brâkmariennes. Il peut vous indiquer comment les fabriquer.', 8800, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (745, 'Trouver le testament.', 'Vous devez trouver le testament d\'Oto dans la tombe de son père, dans le cimetière - elle se reconnait par la gerbe de fleurs qui l\'entoure. Vous devez être transformé en esprit pour y entrer.', 9400, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (746, 'La dèche d\'Oto.', 'Oto n\'a plus un sou. Comment y remédier ?', 10000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (747, 'Récolter la taxe.', 'Vous devez récolter la nouvelle taxe d\'Oto dans chaque taverne de Brâkmar. Carte blanche pour tabasser les taverniers qui ne veulent pas payer.', 10700, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (748, 'Voler le Poumon.', 'Oto veut que vous voliez le Poumon de la plaine à Azra Lazarus, la bijoutière. Il semble qu\'elle ait un garde, mais peut-être est-il possible d\'éviter de le combattre...', 11400, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (749, 'Le grand épluchage.', 'Vous devez éplucher des patates pour le dîner. La cuisine se trouve en bas de la milice.', 12100, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (750, 'Humilier Sbab ?', 'Oto vous a demandé d\'amener dix oreilles de Tiwabbits à Sbab pour l\'horrifier. Mais il y a peut-être une autre solution si vous ne souhaitez pas le faire.', 12800, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (751, 'Aider Raaga.', 'Trouvez Raaga dans les mines du nord et demandez-lui son rapport.', 13500, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (752, 'Retrouver l\'espion.', 'Un espion a réussi à s\'échapper de Brâkmar avec des documents importants. Un des gardes au nord de Brâkmar l\'a peut-être vu.', 14200, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (753, 'Retrouver les documents.', 'Les documents secrets n\'étaient pas sur l\'espion. La faune des landes de Sidimote s\'en est peut-être emparée.', 14900, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (754, 'Défier Puja.', 'Vous êtes censé défier Puja Mustam, le fils d\'Oto, et perdre. Mais vous n\'allez quand même pas vous laisser tuer par ce mioche ?', 15600, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (755, 'Du bois pour Oto.', 'Oto veut 10 écorces d\'abraknyde pour faire du bois de chauffage.', 16300, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (756, 'Acheter l\'équipement.', 'Vous devez acheter l\'équipement qu\'Oto a indiqué sur sa liste et l\'équiper avant de retourner le voir.', 17000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (757, 'Un autre rapport.', 'Vous devez trouver Trojen Tihpor vers les remparts de Bonta et récupérer son rapport.', 19000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (758, 'Trouver un Bontarien pas net.', 'Vous devez trouver un Bontarien coupable d\'assassinat. Pour cela, il faut se procurer un bâton renifleur à Fryda, puis l\'essayer sur des Bontariens jusqu\'à en trouver un qui convienne.', 21000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (759, 'Leçon d\'humilité.', 'Oto vous a ordonné de lui amener 40 yeux de larves bleues.', 23000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (760, 'Se débarrasser de la larve dorée.', 'Vous devez trouver un moyen de vous débarrasser de la larve dorée qui vous suit.', 25000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (761, '32 dents en or !', 'Vous devez apporter un dentier en or pour Mak. Vous pourrez en trouver sur des Chafers d\'élite, mais le forgeron de Brâkmar peut sans doute vous en fournir un aussi.', 28000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (762, 'Récolte de caleçons.', 'Vous devez vaincre des miliciens de Bonta et... récupérer leurs caleçons. Oto en veut cinq.', 31000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (763, 'L\'entretien.', 'Une personnalité importante de Brâkmar a demandé à vous voir. Elle se trouve dans les sous-sols de la tour de Brâkmar.', 17000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (764, 'Du vin pour Oto.', 'Vous devez amener à Oto du vin de Gloutovore. Où pourrait-on trouver ça ?', 17000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (765, 'Anéantir les tortues.', 'Oto vous a demandé de tuer dix tortues de l\'île de Moon. Leurs yeux feront une bonne preuve.', 17000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (766, 'L\'attaque bontarienne.', 'Vous devez vous rendre au rempart Est et y vaincre les Bontariens.', 37000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (767, 'Sortie de prison.', 'Vous devez sauver un guerrier qui a été capturé par Bonta : il se trouve dans la prison de la milice bontarienne, au sous-sol.', 40000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (782, 'Agriculture à haut risque.', 'Kaffra a eu vent des plans de Bonta pour accroître sa production céréalière. Il a besoin de 20 Graines de scorbute pour que cette production serve les desseins de Brâkmar.', 50000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (783, 'Intoxication alimentaire.', 'Suite à votre rapport, Ledrob vous a confié 20 Graines de scorbute modifiées à déposer dans l\'atelier des alchimistes de Bonta. Il faut les déposer de nuit lorsque Merlan l\'Enchaîneur est endormi.', 50000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (784, 'A coeur vaillant, rien d\'impossible.', 'Vous devez trouver un membre de la famille Terra et l\'emmener auprès de Jerhyn Gholein. Setag, le maître de classe Enutrof, pourra sans doute vous aider.', 200000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (785, 'Interro surprise.', 'Elviana Tirips veut savoir quelles informations les renégats bontariens ont données aux Brâkmariens et c\'est vous qui êtes en charge de l\'interrogatoire.', 200000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (786, 'La chasse aux renégats est ouverte.', 'Des renégats bontariens se sont réfugiés à Brâkmar. Vous devez les retrouver et les éliminer puis ramener leur dépouille à Bonta.', 200000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (787, 'J\'ai dit : Lève-toi et marche !', 'La malédiction d\'Erazal vous a appris comment forcer une âme à se réincarner contre sa volonté. Pour cela, il faut créer une potion particulière et suivre un rituel précis.', 50000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (792, 'A la recherche du greffier déprimé.', 'Tabach, Greffier de l\'Ordre du Coeur Vaillant, écume les tavernes depuis la disparition de son chat. Il faut le ramener auprès de Jerhyn Gholein.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (793, 'A la recherche de la greffière.', 'Ybaul, Greffière de l\'Ordre de l\'Esprit Salvateur, écume les tavernes à la recherche de ses frères. Il faut la ramener auprès d\'Elviana Tirips.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (794, 'A la recherche du greffier attristé.', 'Aigurraf, Greffier de l\'Ordre de l\'Œil Attentif, écume les tavernes depuis la disparition de sa souris. Il faut le ramener auprès d\'Ebru Of El.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (795, 'Os de coeur.', 'Kaffra Kyper vous a demandé de lui apporter 1 Os de Chafer pour lui prouver votre valeur.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (796, 'Poils au menton.', 'Divad Dleifrepok vous a demandé de lui apporter 1 Poils de Barbe de Bwork Mage pour lui prouver votre valeur.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (797, 'Mauvais oeil.', 'Ledrob Terceséc vous a demandé de lui apporter 1 Œil de Corbac pour lui prouver votre valeur.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (847, 'L\'éternelle moisson.', 'Vous avez la liste des créatures, reste à les trouver.', 10000, 0, '9686,19;9687', NULL, 0);
