INSERT INTO `quest_step` VALUES (880, 'L\'éternelle moisson.', 'Vous avez la liste des créatures, reste à les trouver.', 53100000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (881, 'L\'ultime Epreuve.', 'Vous avez la liste des créatures, reste à les trouver.', 2500000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (882, 'Le savoir basique.', 'Allez apprendre la technique de la capture d\'âme. La clef du donjon doit se trouver sur les créatures de la région.', 35000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (883, 'Réengagez-vous, qu\'il disait.', 'Snori Nairb a promis de partager ses kamas et son expérience avec vous si vous vous engagez dans la milice de Brâkmar.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (884, 'Réengagez-vous, qu\'il disait.', 'Snori Nairb a promis de partager ses kamas et son expérience avec vous si vous vous engagez dans la milice de Bonta.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (889, 'Une lettre classée X.', 'Il vous faut trouver l\'identité de ce fameux X. Là lettre fait référence à un lieu où il a l\'habitude d\'aller. Trouver ce lieu permettra d\'en savoir plus.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (890, 'Une mission presque achevée.', 'Le chemin est à présent dégagé, même si les gobelins ne constituaient pas une réelle menace. Exoram va enfin pouvoir vous révéler ce qu\'il sait et Oto Mustam sera fier de vous.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (891, 'Une mission loin d\'être achevée.', 'Des traces de lutte et des restes de karne indiquent qu\'Exoram s\'est battu et a été capturé ou tué. Oto Mustam sera furieux de l\'apprendre.', 65000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (892, 'Un Sram plus bête que nature.', 'Exoram s\'est encore mis dans de sales draps. Si vous voulez les informations sur Xephirès, il va falloir l\'aider une nouvelle fois.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (893, 'La rançon.', 'Sabine étant sous bonne garde, vous devez trouver un moyen de contacter le Captain Starky pour exiger un Cristal de Kain Dharyn comme rançon.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (894, 'Le crime ne paie pas.', 'Le message a été envoyé au Captain Starky. En attendant sa réponse, vous devriez aller voir si Sabine s\'est tenue tranquille.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (895, 'Le crime va payer, foi de Brâkmarien.', 'Les Bontariens ont essayé de délivrer Sabine. Ca ne se passera pas comme ça ! Vous devez leur montrer qui commande.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (896, 'Le cristal sombre.', 'Vous devez prendre le passage secret dans l\'atelier des alchimistes avec des maîtres dans leur métier. Il vous faut en plus une Potion de Rafale, une Harmonie et une Kobalite.', 85000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (897, 'Intimidation intime.', 'Il faut intimider Pandalida en saccageant sa maison. Vous avez besoin de 3 Pâtes à Tra Khben, pâte obtenue en concassant 15 Groins du Sanglier, 5 Pots de Gloutovore et 1 Plume de Serpiplume.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (898, 'La confirmation.', 'Pandalida a profité de votre combat pour s\'enfuir, elle s\'est sans doute réfugiée chez elle. Vous DEVEZ la convaincre de remettre la lettre à Xéphirès.', 95000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (899, 'Les andouillettes d\'une andouille.', 'Oto Mustam étant persuadé que vous cherchez à le tromper, il faut impérativement retrouver le joyau avant d\'être transformé en andouillettes.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (900, 'Vengeance, mouahaha.', 'Le repaire des bandits est piégé. Il vous faut trouver un Bricoleur de niveau 30 minimum pour vous accompagner et vous aider à désamorcer les pièges protégeant leur cachette.', 100000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (901, 'Alchimie malfaisante.', 'Vous devez vous procurer des pierres de souillures. Seuls les mineurs sont capables d\'en fabriquer à partir des créations brutes d\'un alchimiste déjanté.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (902, 'Le puits du fou.', 'Vous devez trouver l\'emplacement du Puits des Âmes Souillées afin de révéler le plein potentiel des pierres de souillure. Le maître de l\'Ordre de l\'Esprit Malsain, Divad Dleifrepok, pourra vous aider.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (903, 'Sept âmes sinon rien.', 'Vous devez capturer les âmes de sept bandits et les amener au Puits des Âmes Souillées pour les asservir. Vous aurez besoin de Brâkmariens vils au point de pouvoir se choisir une spécialité.', 105000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (904, 'Un coup de pouce.', 'Oto Mustam est très satisfait du travail du forgeron équipant la milice de Bonta et vous charge de faire en sorte qu\'il continue dans cette voie.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (905, 'Un coup de main.', 'Latem Sa vient de recevoir du minerai et de nouveaux outils. Vous devez profiter de son absence, entre 17 heures et 21 heures, pour dérober le minerai et échanger ses outils.', 122000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (906, 'La bonne planque.', 'Vous devez trouver une nouvelle planque pour les espions entre leur emplacement actuel et la bibliothèque. Au besoin, vous devez neutraliser ses éventuels occupants.', 128000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (907, 'Dompteur de bêtes, mais aussi d\'animaux.', 'Oto Mustam veut connaître le secret du domptage des crocs glands. Vous devez retourner à la bibliothèque de Bonta pour y trouver des indices.', 134000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (908, 'Dompteur de bêtes, mais aussi d\'animaux.', 'Oto Mustam veut connaître le secret du domptage des crocs glands. Vous devez retourner à la bibliothèque de Bonta pour y trouver des indices.', 134000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (909, 'Dompteur de bêtes, mais aussi d\'animaux.', 'Oto Mustam veut connaître le secret du domptage des crocs glands. Vous devez retourner à la bibliothèque de Bonta pour y trouver des indices.', 134000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (910, 'Jamais mieux servi que par soi-même.', 'L\'information révélée par le Tavernier du Ripate n\'est pas exploitable telle quelle. Une recherche auprès des érudits pourrait s\'avérer plus fructueuse.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (911, 'Kokoko, koko ?', 'Pressentant la prochaine mission que vous confiera Oto Mustam, mieux vaut préparer le terrain et acquérir quelques noix de kokoko.', 170000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (912, 'Le tort tue.', 'Turorte ayant faim et la manière forte étant un échec, il faut trouver un moyen de l\'empoisonner. Un habitant de l\'île connaît sûrement l\'alimentation des tortues.', 184000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (913, 'Le wabbit et la tortue.', 'D\'après Oshimo, Turorte se serait fait un ennemi mortel. Lelievwe Pâle Pitane aurait signé un pacte avec les démons pour avoir plus de puissance. Il réside sur l\'île des wabbits squelettes.', 191000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (914, 'Spentox, ça gratouille et ça chatouille.', 'Mulic Bere vous a donné accès à sa forge spéciale pour fabriquer un grattoir à dos Spentox.', 198000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (915, 'La valse des rocheuses.', 'Descendez dans le repaire des bandits à l\'aide d\'une corde. N\'y allez pas seul !', 70000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (916, 'Minou minou.', 'Vous devez mettre la main sur la clef du repaire, ce qui induit forcément de mettre la main sur un bandit la possédant. L\'ex-amant d\'Hersa devrait faire l\'affaire.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (917, 'Clef, sans molette.', 'Vous devez faire des copies de la clef du repaire des bandits avant de pouvoir y pénétrer à plusieurs et d\'y récupérer tout document relatif à l\'enquête.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (918, 'Exoram le Sram.', 'Vous avez ramené Exoram au temple Sram. Cette fois-ci il a intérêt à vous donner les informations qu\'il s vous a promis.', 70000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (919, 'Un Eca ça flippe énormément.', 'Vous pouvez à présent fabriquer des clefs et inspecter le repaire des bandits à la recherche d\'indices. Une corde d\'escalade ne sera pas de trop pour descendre dans le repaire.', 80000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (920, 'Rapport protégé.', 'Un rapport vous accablant de reproches serait actuellement rangé dans la Tour des Ordres de Bonta. Vous devez impérativement mettre la main dessus pour prouver votre innocence.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (921, 'Vol à la tour.', 'Trouvez un complice pour détourner l\'attention du garde pendant que vous effectuerez le larcin.', 85000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (922, 'Complicité accrue.', 'Afin de pénétrer dans les réserves de poison de Brâkmar, vous aurez besoin des services d\'un Sram ou d\'un espion qualifié.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (923, 'L\'alchimie pour les nuls.', 'Vous devez voler le registre des clients dans l\'atelier des alchimistes de Brâkmar et l\'apporter à Rigal Main Crochue.', 90000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (924, 'A la tour.', 'Xarthan a rendez-vous avec un Brâkmarien dans la Tour de Bonta après la réunion des notables. Il vaut mieux vous dépêcher pour ne pas le rater.', 95000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (925, 'Pas d\'issue pour les traîtres.', 'Vous devez faire le tour des miliciens pour les poster à la Tour de Bonta.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (926, 'Liquidation totale.', 'Une Sram doit de l\'argent à Oto Mustam. Comme elle ne l\'a pas remboursé, il a décidé de l\'éliminer à titre d\'exemple. Vous pourrez probablement la trouver dans une salle de jeux clandestine.', 233000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (927, 'Copinage.', 'Kosuke Ichazum avait raison : Latem Sa a obtenu le contrat pour équiper la milice de Bonta par copinage et non pour ses compétences de forgeron.', 116000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (928, 'Pretty Nara.', 'Nara vous a fournit la longue liste de fournitures dont il a besoin pour forger l\'équipement de la milice de Bonta. Vous devez les lui amener dans la Mine des Porcos.', 128000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (929, 'Tac et Tic.', 'Vous devez trouver un tacticien et le convaincre de rejoindre les rangs de Bonta.', 134000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (930, 'Bwork, quelle odeur !', 'Soit Epuop Tik n\'en sait pas plus, soit il refuse de vous en dire davantage. Quoiqu\'il en soit, les bworks mages devraient être moins réticents à vous informer sur l\'un des leurs.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (931, 'Génialissime.', 'Si vous levez la malédiction pesant sur Jibworknouille, il vous divulguera sûrement ce qu\'il sait en signe de reconnaissance. Il a suggéré de se renseigner dans une bibliothèque.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (932, 'La poupée enchantée.', 'Vous devez trouver quatre Sadidas, suffisamment expérimentés pour invoquer des Gonflables, pour un rituel dans les eaux enchantées des lacs Koalaks.', 146000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (933, 'Sadidarne.', 'Touh Flowa vous a indiqué où se trouve l\'entrée de la prison végétale. Comme il avait l\'esprit quelque peu embrumé, il faut espérer qu\'il n\'a rien omis de vous dire.', 158000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (934, 'Une corne à la mer.', 'Selon le Tavernier du Ripate la corne se trouverait sur une île. Des érudits pourront sans doute vous renseigner davantage.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (935, 'Kokoboy.', 'Mieux vaut être prévenant et acquérir un stock de Noix de Kokoko conséquent avant de retourner auprès d\'Amayiro.', 170000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (936, 'Nos amies les bêtes.', 'Amayiro souhaite en savoir plus sur Turorte. Oshimo, le gardien du Chanil, détient sûrement des informations sur cette tortue.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (937, 'Couture à haut risque.', 'Il faut trouver un moyen de rendre au Bandana Troué son éclat et son état d\'antan. Un Tailleur pourra vous aider.', 198000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (938, 'La Révélation.', 'Sous l\'hôtel de vente des alchimistes il y a une armoire. Il vous suffit de vous placer devant pour ouvrir le passage secret. Le Mage Ax vous attend là-bas.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (939, 'Retour au bercail.', 'Il est temps de rentrer à Bonta et de faire le point avec Amayiro.', 226000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (945, 'Engagez-vous, qu\'il disait.', 'Snori Nairb vous a fait entrer illégalement dans la milice de Brâkmar. Pour officialiser la chose, vous devez rendre visite à Oto MUstam.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (946, 'Engagez-vous, qu\'il disait.', 'Snori Nairb vous a fait entrer illégalement dans la milice de Bonta. Pour officialiser la chose, vous devez rendre visite à Amayiro.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (951, 'Ennemi intime.', 'Trouver et éliminer votre cible.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (952, 'Petite blague entre ennemis.', 'Les Brâkmariens devaient remettre les documents à leur supérieur. Vous en avez rédigés des faux pour les remplacer et entraîner vos ennemis sur une fausse piste.', 212000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (953, 'Conduite en prison.', 'Vous devez emmener Sabine de force devant Oto Mustam. Vous devez faire attention à ce qu\'elle ne s\'échappe pas à la première occasion.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (955, 'Agence immobilière.', 'Vous avez visité les différents lieux indiqués par Setag. Reste à convaincre Nara de déménager dans l\'un d\'eux.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (956, 'Ordre ou contrordre ?', 'Le plan d\'attaque actuel n\'étant pas confirmé, vous devez trouver sa confirmation ou ses modifications auprès de l\'officier Kapi Taigne et rapporter ces informations à Amayiro.', 164000, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (963, 'Un coup fourré.', 'Afin de saboter l\'équipement de Bonta, Oto Mustam veut que vous remplaciez les outils de ses forgerons par 5 Marteaux Martel.', 0, 0, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (979, 'Vaincre le dopeul.', 'En cas de victoire contre le dopeul, le maître des combats vous récompensera.', 0, 0, '0', '1|7106;', 0);
INSERT INTO `quest_step` VALUES (982, 'Vaincre le dopeul.', 'En cas de victoire contre le dopeul, le maître des combats vous récompensera.', 0, 0, '0', '1|7106;', 0);
