INSERT INTO `quest_step` VALUES (1102, 'L\'île d\'Otomaï et sa faune.', 'Malgré son paysage paradisiaque et sa flore riche, on ressent une force pesante sur l\'île, cette sensation s\'agrandit quand on regarde au loin... en direction de la tourbière. Avant de vous aventurer au plus profond de celle-ci, il serait judicieux de connaître un peu mieux les alentours.', 2000000, 40000, '0', NULL, 0);
INSERT INTO `quest_step` VALUES (1103, 'Porte, monstre, trésor', 'Notend Less vous mets au défi de venir à bout de son Gladiatrool.', 0, 0, '16000,1250', NULL, 0);
INSERT INTO `quest_step` VALUES (1104, 'Porte, monstre, trésor... mais douze fois !', 'Vous avez surmonté l\'épreuve du Gladiatrool, serez-vous capable de réitérer l\'exploit avec les douze armes ?', 0, 0, '16001,10', NULL, 0);
